{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "echo \"--INSTALL PHASE--\"",
        "npm install --silent --no-progress serverless -g"
      ]
    },
    "pre_build": {
      "commands": [
        "echo \"--PRE BUILD PHASE--\"",
        "npm install --silent --no-progress"
      ]
    },
    "build": {
      "commands": [
        "echo \"--BUILD PHASE--\"",
        "serverless deploy -s $STAGE"
      ]
    }
  },
  "artifacts": {
    "files": [
      "**/*"
    ],
    "base-directory": ".serverless"
  }
}

{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "pip install awscli"
      ]
    },
    "pre_build": {
      "commands": [
        "npm install --no-audit"
      ]
    },
    "build": {
      "commands": [
        "npm run build"
      ]
    },
    "post_build": {
      "commands": [
        "aws cloudfront create-invalidation --distribution-id $distributionid --paths \"/*\" "
      ]
    }
  },
  "artifacts": {
    "files": [
      "build/**/*"
    ]
  },
  "cache": {
    "paths": [
      ".node_modules/**/*"
    ]
  }
}
